response.activities:
🔴Провожу КОНСУЛЬТАЦИИ по различным запросам:
✔ кризиса жизни (нет понимания куда двигаться дальше, как исправить текущее состояние, где черпать силы, над чем работать и в чём искать причины затыка); 
✔ поиска решения для сложившихся трудностей в любой сфере (отношений, карьеры, предназначения, личностного роста, финансов, жизненного пути, здоровья); 
🔴Провожу СЕАНСЫ ЭНЕРГОТЕРАПИИ для тех, кто:
✔ ищет дополнительный ресурс для решения своих задач, ✔ ищет альтернативные способы помочь своему организму выздороветь и восстановиться;
✔ или же просто испытываете хроническую усталость, тревожность, раздражительность. 
🔴 Для записи и вопросов - пишите в лс, ПЕРВАЯ ДИАГНОСТИЧЕСКАЯ КОНСУЛЬТАЦИЯ - БЕЗОПЛАТНО!

Все вопросы имеют решения!
